.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"370759","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"370635"},"glyph":{"id":"370637"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"370639"},"nonselection_glyph":{"id":"370638"},"view":{"id":"370641"}},"id":"370640","type":"GlyphRenderer"},{"attributes":{},"id":"370375","type":"RedoTool"},{"attributes":{"children":[{"id":"370844"},{"id":"370846"}],"sizing_mode":"stretch_width"},"id":"370847","type":"Row"},{"attributes":{"coordinates":null,"data_source":{"id":"370387"},"glyph":{"id":"370650"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"370652"},"nonselection_glyph":{"id":"370651"},"view":{"id":"370654"}},"id":"370653","type":"GlyphRenderer"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"370437","type":"Line"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"returns_positive","transform":{"id":"370390"}},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"marker":{"value":"tr
